import React from "react";
import "../css/contact.css"

const ContactPage = () => {
    return(
    <div className="contacts">
        <ul>
            <li><h4>Github: - </h4><a href="https://github.com/KennyDev0213">github</a></li>
            <li><h4>Itch.IO: - </h4><a href="https://kennydev0213.itch.io/">itch.io</a></li>
            <li><h4>Email: - </h4> Kedong0213@gmail.com</li>
            <li><h4>Phone Number: - </h4> 778-861-8003</li>
        </ul>
    </div>
    )
}

export default ContactPage;
